DROP TABLE IF EXISTS businessobject;


-- BUSINESSOBJECT TABLE (everything extends this);
CREATE TABLE businessobject (
  id           VARCHAR(40) PRIMARY KEY,
  botype       VARCHAR(250)
);


  -- STORE TABLE;
CREATE TABLE store (
  id              VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
  location        VARCHAR(250),
  managerid       VARCHAR(250),
  address         VARCHAR(250),
  phone           VARCHAR(250),
  salestaxrate    NUMERIC(8,3),
  subnetid        VARCHAR(250)
  );

  -- CUSTOMER TABLE;
CREATE TABLE customer(
  id              VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
  firstname       VARCHAR(250),
  lastname        VARCHAR(250),
  phone           VARCHAR(250),
  email           VARCHAR(250),
  address         VARCHAR(250),
  city            VARCHAR(250),
  state           VARCHAR(250),
  zip             VARCHAR(250),
  validated       boolean,
  password        VARCHAR(250),
  validationcode  VARCHAR(250),
  member          boolean
  );
