-- Membership table;  
 CREATE TABLE membership(
 id           VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
 creditcard   VARCHAR(250),
 startdate    VARCHAR(250),
 expirationdate VARCHAR(250),
 securitycode   VARCHAR (250),
 trial        boolean,
 custid       VARCHAR(40) REFERENCES customer(id)
 
 );
  
  -- TRANSACTION TABLE;
CREATE TABLE trans(
  id              VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
  dateof          DATE,
  subtotal        NUMERIC(8,2),
  tax             NUMERIC(12,3),
  custid          VARCHAR(40) REFERENCES customer(id),
  storeid         VARCHAR(40) REFERENCES store(id),
  total           NUMERIC(8,2),
  empid           VARCHAR(250)
  );

-- REVENUESOURCE TABLE;
CREATE TABLE revenuesource (
  id              VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
  chargeamt       NUMERIC(8,2),
  transid         VARCHAR(40) REFERENCES trans(id),
  typeof          VARCHAR(250)
  );
  
    -- PRODUCT TABLE;
CREATE TABLE product (
  id              VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
  price	          NUMERIC(8,2),
  typeof          VARCHAR(250),
  model           VARCHAR(250)
  );
  
  
-- SALE TABLE (extends REVENUESOURCE table);
CREATE TABLE sale (
  id             VARCHAR(40) PRIMARY KEY REFERENCES revenuesource(id),
  quantity       NUMERIC(8,2),
  productid      VARCHAR(40) REFERENCES product(id)
);

--PRINT ORDER TABLE (extends REVENUESOURCE table);
CREATE TABLE printorder(
	id           VARCHAR(40) PRIMARY KEY REFERENCES revenuesource(id),
	photoid      VARCHAR(40),
	printid      VARCHAR(250),
	quantity     INT
	);
	
	
--PHOTO TABLE;
CREATE TABLE photo(
	id           VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
	caption      VARCHAR(250),
	custid       VARCHAR(40) REFERENCES customer(id),
	dateof       DATE,
	picas64      MEDIUMTEXT);
	
--PRINT TABLE;
CREATE TABLE print(
	id           VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
	price        NUMERIC(8,2),
	size         VARCHAR(250),
	typeof       VARCHAR(250)
	);
	

--CONCEPTUALPRODUCT TABLE;
CREATE TABLE cproduct (
  id              VARCHAR(40) PRIMARY KEY REFERENCES product(id),
  description     TEXT,
  model 		  VARCHAR(250),
  manufacturer    VARCHAR(250),
  averagecost     NUMERIC(8,2),
  commissionrate  NUMERIC(4,2),
  typeof          VARCHAR(250),
  sku             VARCHAR(250)
  );
  --do i need to create a cproduct with id 'crental3' in the cproduct table?;
  




 -- CONCEPTUALRENTAL TABLE;
CREATE TABLE crental (
  id			 VARCHAR(40) PRIMARY KEY REFERENCES cproduct(id),
  priceperday    NUMERIC(8,2),
  replacementprice NUMERIC(8,2)
  );
