   -- FORRENT TABLE;
CREATE TABLE forrent (
  id              VARCHAR(40) PRIMARY KEY REFERENCES pproduct(id),
  serial          VARCHAR(250) REFERENCES pproduct(serial),
  timesrented        INT,
  typeof          VARCHAR(250)
  );
