       -- RENTAL TABLE;
CREATE TABLE rental (
  id			 VARCHAR(40) PRIMARY KEY REFERENCES revenuesource(id),
  dateout        DATE,
  datein         DATE,
  datedue 		 DATE,
  remindersent	 BOOLEAN,
  forrentid      VARCHAR(40) REFERENCES forrent(id)
  );
-- EMPLOYEE TABLE;
CREATE TABLE employee(
  id           VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
  firstname    VARCHAR(250),
  lastname     VARCHAR(250),
  hiredate     DATE,
  phone        VARCHAR(100),
  salary       NUMERIC(8,0),
  username     VARCHAR(250),
  password     VARCHAR(250),
  address      VARCHAR(250),
  city         VARCHAR(250),
  state        VARCHAR(250),
  zip          VARCHAR(250),
  position     VARCHAR(250),
  storeid      VARCHAR(40) REFERENCES store(id)
  );
    
  
         -- FEE TABLE;
CREATE TABLE fee (
  id			 VARCHAR(40) PRIMARY KEY REFERENCES revenuesource(id),
  amount         NUMERIC(8,2),
  rentalid 		 VARCHAR(40) REFERENCES rental,
  empid	 	     VARCHAR(40) REFERENCES employee,
  waived         boolean
  );

	
-- STOREPRODUCT TABLE;
CREATE TABLE storeproduct(
  id              VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
  storeid         VARCHAR(40) REFERENCES store(id),
  productid       VARCHAR(40) REFERENCES product(id),
  shelflocation   VARCHAR(250),
  quantityonhand  INT
  );
  
  
  -- GENERALLEDGER TABLE;
CREATE TABLE generalledger(
  id              VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
  accountname     VARCHAR(250),
  balance         NUMERIC(8,2),
  typeof          VARCHAR(250)
  );
  
  
  
  -- COMMISSION TABLE;
CREATE TABLE commission(
  id              VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
  empid           VARCHAR(40) REFERENCES employee(id),
  amount          NUMERIC(8,2),
  dateof          DATE,
  transid         VARCHAR(250)
  );
    
  -- JOURNALENTRY TABLE;
CREATE TABLE journalentry(
  id              VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
  dateof          DATE,
  transid         VARCHAR(250)
  );
  
  -- DEBITORCREDIT TABLE;
CREATE TABLE debitorcredit(
  id              VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
  dcboolean       BOOLEAN,
  glname          VARCHAR(250),
  journalentryid  VARCHAR(40) REFERENCES journalentry(id),
  amount          NUMERIC(8,2),
  generalledgerid VARCHAR(250)
  );

  -- PAYMENT TABLE;
CREATE TABLE payment (
  id              VARCHAR(40) PRIMARY KEY REFERENCES businessobject(id),
  amount          NUMERIC(8,2),
  changeback      NUMERIC(8,2),
  typeof          VARCHAR(250),
  transid         VARCHAR(40) REFERENCES trans(id)
  );
  



