  INSERT INTO cproduct (id, model, description, manufacturer, typeof, sku) VALUES ('cproduct5', '6D','The EOS 6D DSLR camera is the ideal tool for unlocking your creative vision. It features a 20.2 Megapixel Full-Frame CMOS sensor, a wide ISO range of 100-25600, expandable to L: 50, H1: 51200, and H2: 102400, for incredible image quality even in low light, and a DIGIC 5+ Image Processor delivers enhanced noise reduction and exceptional processing speed. A new 11-point AF including a high-precision center cross-type AF point with EV -3 sensitivity allows focusing in extreme low-light conditions, and with continuous shooting up to 4.5 fps, you are ready to capture fast action. Full HD video with manual exposure control, multiple frame rates, and the benefits of a Full-Frame sensor provides stunning performance and creative flexibility. The built-in Wi-Fi transmitter allows you to wirelessly transfer your images to social networking sites through CANON iMAGE GATEWAY, or upload virtually anywhere from your iOS or Android smartphone with the free download of the EOS Remote app. You can use your smartphone for remote camera control and operation (with the EOS Remote app), or even print your images on a Wi-Fi compatible printer^. Perfect for travel and nature photography, the built-in GPS allows location data to be recorded while shooting. Compact, lightweight, brilliant low-light performance, and loaded with easy to use features, the EOS 6D is truly the Full-Frame DSLR camera for everyone.', 'Canon','FORSALE', 'sku5');
  INSERT INTO cproduct (id, model, description, manufacturer, typeof, sku) VALUES ('cproduct6', '7D','Beyond the Still. With a host of features designed to enhance every facet of the photographic process, from still images to video, the EOS 7D represents an advanced class of camera. Made to be the tool of choice for serious photographers and semi-professionals, the EOS 7D features an 18.0 Megapixel APS-C size CMOS sensor and Dual DIGIC 4 Image Processors, capturing tremendous images at up to ISO 12800 and speeds of up to 8.0 fps. The EOS 7D has an all cross-type 19-point AF system with improved AI Servo AF subject tracking and user-selectable AF area selection modes for sharp focus no matter the situation. The EOS 7Ds Intelligent Viewfinder provides 100 coverage and displays user-selected AF modes as well as a spot metering circle and on-demand grid lines. iFCL Metering with 63-zone dual-layer metering system uses both focus and color information to provide accurate exposure even in difficult lighting. The EOS 7D also captures Full HD video at 30p (29.97 fps), 24p (23.976 fps) and 25p with an array of manual controls, including manual exposure during video shooting and ISO speed selection. The EOS 7D features a magnesium alloy body that is dust and weather resistant and shutter durability of up to 150,000 cycles. Compatible with over 60 EF and EF-S lenses as well as with EOS System accessories, the creative opportunities  not just with stills but also with video  are beyond amazement. Since its introduction, the Canon EOS 7D has become one of the most popular APS-C EOS DSLRs among serious photographers and semi-professionals. Now, Canon is giving the EOS 7D an exciting upgrade with new Firmware Version 2.0.X! With Firmware Version 2.0.X, the EOS 7D gains a multitude of feature enhancements for higher performance befitting the flagship APS-C EOS. These improvements include a higher maximum burst rate (130 for JPEG Large/Fine and 25 RAW images) for continuous shooting, definable maximum limit for ISO Auto, compatibility with the GPS Receiver GP-E2, and manual audio level adjustment. Additional upgrades also include faster scrolling of magnified images, quick control during playback, in-camera RAW image processing, JPEG image resizing and ratings, plus customization of file names and time zone settings. These significant enhancements are a sure-fire way to make an amazing camera even better than ever before!' , 'Canon','FORSALE', 'sku6');
  INSERT INTO cproduct (id, model, description, manufacturer, typeof, sku) VALUES ('cproduct7', '60D','An EOS with Perspective. With the new EOS 60D DSLR, Canon gives the photo enthusiast a powerful tool fostering creativity, with better image quality, more advanced features and automatic and in-camera technologies for ease-of-use. It features an improved APS-C sized 18.0 Megapixel CMOS sensor for tremendous images, a new DIGIC 4 Image Processor for finer detail and excellent color reproduction, and improved ISO capabilities from 100 - 6400 (expandable to 12800) for uncompromised shooting even in the dimmest situations. The new Multi-control Dial enables users to conveniently operate menus and enter settings with a simple touch. The EOS 60D also features an EOS first: A Vari-angle 3.0-inch Clear View LCD (1,040,000 dots) monitor for easy low- or high-angle viewing. An improved viewfinder, a number of new in-camera creative options and filters, plus HDMI output for viewing images on an HDTV all make the EOS 60D invaluable for the evolving photographer. With continuously curved surfaces, user-friendliness and exuding solidity and refinement, the EOS 60D is true digital inspiration!', 'Canon','FORSALE', 'sku7');
  INSERT INTO cproduct (id, model, description, manufacturer, typeof, sku) VALUES ('cproduct8', 'Cleaner','Cleaning Cleaner Kit includes: 1) Canon Optical Lens Cleaning Kit 2) Lenspen Lens Cleaning System 3) Precision Design Deluxe Hurricane Blower. Designed for photographers on the go, this cleaning kit from Canon is perfect for keeping lenses free from dust and grime on a daily basis, and for removing difficult spots from lens surfaces. Complete with a soft retractable brush, lens cleaning fluid, microfiber cloth, lens tissues and a sturdy plastic case, this kit is ideal for anyone who needs a practical lens cleaning solution that fits comfortably in any camera bag or coat pocket. The LensPen is one of the most invaluable accessories a photographer can own. Its unique design makes cleaning your lens fast, simple and effective. On one end, a retractable soft brush sweeps dust and loose particles away from the glass. On the other end, a special dry cleaning compound is used to gently remove fingerprints and spots. The Precision Design Deluxe Hurricane Blower is very powerful and easy to use cleaning system. The super air stream blows off dust particles, even those attracted by static electricity, without any physical contact. It works great when used on digital camera sensors, lenses, telescopes, computer keyboards, microscopes, communications equipment, musical instruments and much more. ', 'Canon','conceptual', 'sku8');  
  INSERT INTO cproduct (id, model, description, manufacturer, typeof, sku) VALUES ('cproduct9', 'COOLPIX A','Nikon COOLPIX A 16.2MP DX-Format CMOS Sensor NIKKOR 18.5mm Lens (35mm Equiv: 28mm) N Optical Low-Pass Filter Fast f/2.8 Maximum Aperture 3.0" 921k-Dot LCD Monitor Full HD 1080p Video with Stereo Sound Capture Photos in RAW Format Manual Focus Ring Adjustment Auto and Manual Exposure Bracketing Wi-Fi via Optional WU-1a Adapter', 'Nikon','FORSALE', 'sku9');  
  INSERT INTO cproduct (id, model, description, manufacturer, typeof, sku) VALUES ('cproduct10', 'COOLPIX P330','Nikon COOLPIX P330 12.2MP BSI-CMOS sensor w Mode (.NRW) 24-120mm (equivalent) F1.8-5.6 optically-stabilized zoom lens ISO 80-3200 (up to ISO 12,800 in manual mode) Maximum 10fps shooting (for 10 frames) Full HD, 1080/60i/30p movie recording 3" 921k-dot rear LCD screen 23 Scene modes including 3D Built-in GPS Approx 200 shots per charge (CIPA)', 'Nikon','FORSALE', 'sku10');  
  INSERT INTO cproduct (id, model, description, manufacturer, typeof, sku) VALUES ('cproduct11', 'COOLPIX S800c','Nikon COOLPIX S800c 16MP 1/2.3"-type BSI CMOS sensor 25-250mm equivalent F3.2-5.8 lens 3.5" WVGA OLED touchscreen Android v2.3 operating system Wi-Fi, Bluetooth and GPS 2GB of internal memory (690MB of this for Apps) Up to 8fps continuous shooting 1080p30 video', 'Nikon','FORSALE', 'sku11');  
  INSERT INTO cproduct (id, model, description, manufacturer, typeof, sku) VALUES ('cproduct12', 'COOLPIX S9500','Nikon COOLPIX S9500', 'Nikon','FORSALE', 'sku12');    
  INSERT INTO cproduct (id, model, description, manufacturer, typeof, sku) VALUES ('cproduct13', 'D600',' D600 Nikons most compact FX-format HD-SLR,Limited 1-Year Warranty. Newly developed 24.3 MP FX-format CMOS sensor Share D600 images with the optional WU-1b Wireless Mobile Adapter (sold seperately) Cinema-quality Full HD (1080) Compatible with all NIKKOR lenses, FX and DX formats', 'Nikon','FORSALE', 'sku13');  
  INSERT INTO cproduct (id, model, description, manufacturer, typeof, sku) VALUES ('cproduct14', 'D3200','Nikon D3200 Wi-Fi Connectivity with adapter (not included) 24.2 MP DX-format CMOS sensor,Display Screen 3.0-Inch Rear Screen, LCD (921000) EXPEED III Image Processing Wide ISO sensitivity range,Filter Thread: 52 mm One-touch Full HD 1080p movie recording', 'Nikon','FORSALE', 'sku14');  
  INSERT INTO cproduct (id, model, description, manufacturer, typeof, sku) VALUES ('cproduct15', 'D5100','Nikon D5100 3-inch, 921,000-dot Super-Density horizontal type Vari-Angle LCD Monitor In-camera Special Effects Mode, 1 Yr Camera / 5 Yrs Lens In-camera HDR (High Dynamic Range) Stunning Full 1080p HD Movies with Full Time Autofocus ISO Sensitivity: 100-6400 (Extended Mode: 100-25600', 'Nikon','FORSALE', 'sku15');  
